import { Link } from 'react-router-dom';
const AppointmentItem = (appointments) => {
  return (
    <div className='appointment-items'>
      <div className='items-header'>
        <h3>Datee</h3>
        <h3>Time</h3>
        <h3>Technician</h3>
        <h3>Type</h3>
        <h3>Status</h3>
        <h3>Price</h3>
      </div>
      <div className='' key={appointments.id}>
        <h3>{appointments.date}</h3>
        <h3>{appointments.time}</h3>
        <h3>{appointments.technician}</h3>
        <h3>{appointments.type}</h3>
        <h3>{appointments.status}</h3>
        <h3>{appointments.price}</h3>
      </div>
    </div>
  );
};
export default AppointmentItem;
